                .replace(minutesRE, match => paddNum(date.getMinutes(), match.length))
                .replace(secondsRE, match => paddNum(date.getSeconds(), match.length))
                .replace(AMPMClockRE, match => isPM(date.getHours()) ? 'PM' : 'AM')
